css:
.top-bar {
    background: #f7f7f7;
    width: 100%;
}
.header {
  background: #ffffff;}
.body{font-family: 'Nobile', sans-serif;}
.header__toggler {
  color: #ffffff; font-size:0px;}
.footer {
    background: #dd99a7;
    border-top: var(--spacer-1) solid #d58b9b;
}
.footer__store {
    color: #f7d9dd;font-family: 'Nobile', sans-serif;
    font-weight: var(--font-headings);
}
.footer__title[aria-expanded] {color: #f7d9dd;font-family: 'Nobile', sans-serif;}
.footer__links i {
    color: #dc5b6b;
}
.i-whatsapp{color: #f7d9dd;}
.i-facebook:before{color: #f7d9dd;}
.i-instagram:before{color: #f7d9dd;}
.stamps img {max-width: 70%;}
.footer__credits {
     border-top: var(--border-width) solid #f7d9dd;}
.btn-primary {
    background-color:#f7d9dd;
    border-color: #f7d9dd;
    color: #dc5b6b;
}
.i-user{color: #6f6f6f;}
.i-search{color: #6f6f6f;}
.menu {
  background: #cb848f;}
.menu__footer a {
    color: #f7d9dd;
    text-decoration: none;
}
.pb-lg-4{
